import './Expenses.css';

function Expenses(props) {
const expenses = props
    return (
        <div className='expenses'>
 {expenses.map((objectMy) => (
        <ExpenseItem
          key={objectMy.id}
          title={objectMy.title}
          amount={objectMy.amount}
          date={objectMy.date}
        />
      ))}
        </div>
    )
}
